import React from 'react';
import { useFormValidation } from '../hooks/useFormValidation';
import { useNotification } from '../context/NotificationContext';
import Input from '../components/common/Input';
import Button from '../components/common/Button';

const validationRules = {
  name: [
    value => !value ? 'El nombre es requerido' : '',
    value => value.length < 2 ? 'El nombre debe tener al menos 2 caracteres' : ''
  ],
  email: [
    value => !value ? 'El email es requerido' : '',
    value => !/\S+@\S+\.\S+/.test(value) ? 'El email no es válido' : ''
  ],
  message: [
    value => !value ? 'El mensaje es requerido' : '',
    value => value.length < 10 ? 'El mensaje debe tener al menos 10 caracteres' : ''
  ]
};

function Contact() {
  const { showNotification } = useNotification();
  const initialValues = { name: '', email: '', message: '', phone: '' };

  const {
    values,
    errors,
    touched,
    handleChange,
    handleBlur,
    handleSubmit
  } = useFormValidation(initialValues, validationRules);

  const onSubmit = async (formData) => {
    try {
      // Aquí iría la llamada a la API para enviar el formulario
      console.log('Formulario enviado:', formData);
      showNotification('Mensaje enviado exitosamente', 'success');
    } catch (error) {
      showNotification('Error al enviar el mensaje', 'error');
    }
  };

  return (
    <div className="container mx-auto px-4 py-8 max-w-2xl">
      <div className="text-center mb-8">
        <h1 className="text-3xl font-bold text-gray-800 mb-4">Contacto</h1>
        <p className="text-gray-600">
          ¿Tienes alguna pregunta? Estamos aquí para ayudarte.
        </p>
      </div>

      <form onSubmit={(e) => {
        e.preventDefault();
        handleSubmit(onSubmit);
      }} className="space-y-6 bg-white p-6 rounded-lg shadow">
        <Input
          label="Nombre"
          name="name"
          value={values.name}
          onChange={handleChange}
          onBlur={handleBlur}
          error={touched.name && errors.name}
          touched={touched.name}
          placeholder="Tu nombre"
        />

        <Input
          label="Email"
          name="email"
          type="email"
          value={values.email}
          onChange={handleChange}
          onBlur={handleBlur}
          error={touched.email && errors.email}
          touched={touched.email}
          placeholder="tu@email.com"
        />

        <Input
          label="Teléfono (opcional)"
          name="phone"
          type="tel"
          value={values.phone}
          onChange={handleChange}
          onBlur={handleBlur}
          placeholder="Tu número de teléfono"
        />

        <div className="form-group">
          <label className="block mb-2 font-medium text-gray-700">
            Mensaje
          </label>
          <textarea
            name="message"
            value={values.message}
            onChange={handleChange}
            onBlur={handleBlur}
            rows="6"
            className={`w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2
              ${touched.message && errors.message 
                ? 'border-red-500 focus:ring-red-200' 
                : 'border-gray-300 focus:ring-blue-200'}`}
            placeholder="¿En qué podemos ayudarte?"
          />
          {touched.message && errors.message && (
            <p className="mt-1 text-sm text-red-500">{errors.message}</p>
          )}
        </div>

        <Button
          type="submit"
          variant="primary"
          fullWidth
        >
          Enviar Mensaje
        </Button>
      </form>

      <div className="mt-8 grid md:grid-cols-3 gap-6">
        <div className="text-center p-4">
          <h3 className="font-semibold mb-2">Dirección</h3>
          <p className="text-gray-600">Av. Principal 123, Montevideo</p>
        </div>
        <div className="text-center p-4">
          <h3 className="font-semibold mb-2">Email</h3>
          <p className="text-gray-600">contacto@charruashockey.com</p>
        </div>
        <div className="text-center p-4">
          <h3 className="font-semibold mb-2">Teléfono</h3>
          <p className="text-gray-600">+598 2345 6789</p>
        </div>
      </div>
    </div>
  );
}

export default Contact;
